const EntityBaseModel = require('./entity-base-model');

class AppEntityBaseModel extends EntityBaseModel{
    constructor(request) {
        super(request)
        this.appId = request.appId;
    }
}

class AppLocationEntityBaseModel extends EntityBaseModel{
    constructor(request) {
        super(request)
        this.appId = request.appId;
    }
}

module.exports = {
    AppEntityBaseModel,
    AppLocationEntityBaseModel
}